sys_variable_value.value:
(function execute(inputs, outputs) {
    gs.info("DEBUG: Raw response_body - " + inputs.response_body);

    if (inputs.status_code == '200' && inputs.response_body) {
        try {
            // Check if the response body is unexpectedly "undefined"
            if (typeof inputs.response_body !== "string") {
                gs.error("ERROR: response_body is not a string. Actual type: " + typeof inputs.response_body);
                return;
            }

            // Trim whitespace and check if the response is invalid
            let trimmedResponse = inputs.response_body.trim();
            if (trimmedResponse.toLowerCase() === "undefined" || trimmedResponse.toLowerCase() === "null") {
                gs.error("ERROR: response_body contains an invalid value: " + trimmedResponse);
                return;
            }

            // Parse JSON safely
            var responseBody = JSON.parse(trimmedResponse);
            gs.info("DEBUG: Successfully parsed JSON");

            // Assign values safely
            outputs.hostname = responseBody.hostname || "";
            outputs.city = responseBody.city || "";
            outputs.region = responseBody.region || "";
            outputs.country = responseBody.country || "";

            // Parse location safely
            if (responseBody.loc) {
                var locArray = responseBody.loc.split(",");
                outputs.latitude = locArray.length > 0 ? locArray[0] : "";
                outputs.longitude = locArray.length > 1 ? locArray[1] : "";
            }
        } catch (error) {
            gs.error("ERROR: JSON parsing failed - " + error.message);
        }
    } else {
        gs.error("ERROR: Invalid status_code or response_body: " + inputs.status_code + " | " + inputs.response_body);
    }
})(inputs, outputs);

